package main

import (
	"fmt"
)

func lengthOfLongestSubstringOptimized(s string) int {
	// 'abcabcbb'
	recordMap := make(map[string]int)

	left := 0
	longest := 0

	longestRIdx := 0
	longestLIdx := 0

	for right := 0; right < len(s); right++ {
		c := string(s[right])

		if idx, ok := recordMap[c]; ok {
			// repeating character found
			// move left cursor to the next index of the repeating character when the next index is ahead of the existing left cursor
			nextIdx := idx + 1
			if nextIdx > left {
				left = nextIdx // exclude the repeating character
			}
		}

		// update record for longest if needed
		currLen := right - left + 1
		if currLen > longest {
			longest = currLen

			longestRIdx = right
			longestLIdx = left
		}

		recordMap[c] = right
	}

	if longestRIdx > longestLIdx {
		fmt.Printf("'%s'\n", s[longestLIdx:longestRIdx+1])
		fmt.Printf("%d\n", longest)
	}

	return longest
}

func lengthOfLongestSubstring(s string) int {
	recordMap := make(map[string]int)

	left := 0
	right := 0

	longest := 0
	longestRIdx := 0
	longestLIdx := 0

	for right < len(s) {
		c := string(s[right])

		// record the character
		recordMap[c] = recordMap[c] + 1

		// encountered repeating character, update record map while moving left cursor
		for recordMap[c] > 1 {
			lc := string(s[left])
			recordMap[lc] = recordMap[lc] - 1
			left++
		}

		currLength := right - left + 1
		if currLength > longest {
			longest = currLength
			longestLIdx = left
			longestRIdx = right
		}

		// move the right cursor
		right++
	}

	if longestRIdx > longestLIdx {
		fmt.Printf("'%s'\n", s[longestLIdx:longestRIdx+1])
		fmt.Printf("%d\n", longest)
	}

	return longest
}

